/** Reference source
 * https://blog.loadero.com/2020/04/28/how-to-handle-multiple-flows-in-a-test/
 * https://blog.loadero.com/2021/01/25/how-to-create-an-automated-login-page-test-and-use-multiple-credentials/
 * */

module.exports = {
    'Start': function (client) {
        const liveDomain = client.globals.liveDomain || `live.research.kidsloop.live`;
        const groupName = client.globals.group.name;
        const partipantID = client.globals.participant.id;

        client.useXpath();
        const tokens = {"accessToken":"eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCIsImlzc3VlciI6ImNhbG1pZC1kZWJ1ZyJ9.eyJpZCI6ImEwOGYyZWY4LTVmMTMtNDg4My05ZDA4LTY4NGIxNjc3ODkwMyIsImVtYWlsIjoicWErc3RyZXNzX3QxQGNhbG1pZC5jb20iLCJleHAiOjE5NDUyMDg5OTgsImlzcyI6ImNhbG1pZC1kZWJ1ZyIsImlhdCI6MTY0NTc1NDUwOH0.4wGpGnErOP7y-YlQWQS3BO7J7kgs7tPtgn-ftlIJVcI","teacherTokens":["eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCIsImlzc3VlciI6ImNhbG1pZC1kZWJ1ZyJ9..cX1_S_94KsbJDllbtGy_jxXkMwSViM6rIMgeHAt3wgY","eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCIsImlzc3VlciI6ImNhbG1pZC1kZWJ1ZyJ9..Pm7eWBxNa3HDJUnmXB5ZNi69I6V8xMfE8V-KtQ-WGxk"],"studentTokens":["eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCIsImlzc3VlciI6ImNhbG1pZC1kZWJ1ZyJ9..3N5MjjWqROSLJcF9OKH3ST-e4EF7AnOEEuhtpGoX-RA","eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCIsImlzc3VlciI6ImNhbG1pZC1kZWJ1ZyJ9..IiGPbAIDIj8K823GrXbdVRgB_EWF6mrnlf1lZwOnVtU","eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCIsImlzc3VlciI6ImNhbG1pZC1kZWJ1ZyJ9..sf9VUY8jRaRCAAbfidIV-RhARFUKRrn2fAP0qeAu3WI","eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCIsImlzc3VlciI6ImNhbG1pZC1kZWJ1ZyJ9..ZV3rqKbvuvrX6rNqqWYgChaoEq55Hjh4T4aFo9iUpso"]}

        function getParticipantMutedCameraSelectorInDockedRightByName(participantName) {
            return `(//div[contains(@class,'MuiDrawer-paperAnchorDockedRight')])[2]//div[contains(@id,'participant') and .//span[contains(.,'${participantName}')]][.//div[contains(@class,'MuiAvatar')]]`;
        }

        function getParticipantUnmutedCameraSelectorInDockedRightByName(participantName) {
            return `(//div[contains(@class,'MuiDrawer-paperAnchorDockedRight')])[2]//div[contains(@id,'participant') and .//span[contains(.,'${participantName}')]][not(.//div[contains(@class,'MuiAvatar')])]`;
        }

        function joinRoom(client, token) {
            return client
                .url(`https://${liveDomain}/?token=${token}&selectionStrategy=random`)
                .setCookie({
                    name: `access`,
                    value: tokens.accessToken,
                    path: `/`,
                    domain: `.research.kidsloop.live`,
                    secure: false,
                    httpOnly: false,
                })
                .waitForElementVisible(`//body`)
                .assert.titleContains("KidsLoop Live")
                .waitForElementVisible(`//button[normalize-space()='Join Room'][not(@disabled)]`)
                .click(`//button[normalize-space()='Join Room'][not(@disabled)]`)
                .waitForElementNotPresent(`//h6[normalize-space()='Loading'][not(@disabled)]`, 10 * 1000)
                .verify.visible(`//div[@id='main-content']`)
                .takeScreenshot(`joined.png`);
        }

        if (groupName === `teacher-group`) {
            joinRoom(client, tokens.teacherTokens[partipantID]);
            // The participant is Host Teacher if the streaming element has a crown icon
            client.element(`xpath`,`//div[@id='main-content']//div[contains(@class,'MuiGrid-container') and .//span[contains(.,'You')]][.//*[name()='path' and contains(@d,'M528 448H112c-8.8 0-16')]]`, result => {
                // Host Teacher
                if (result.value) {
                    client
                        // Host teacher wait until Student 1 joined room
                        .waitForElementVisible(`(//div[contains(@class,'MuiDrawer-paperAnchorDockedRight')])[2]//div[contains(@id,'participant')][2]`, 60 * 1000)
                        // Click GlobalAction button
                        .click(`//div[*[name()='svg' and *[name()='path' and contains(@d,'M10 .4C4.705.4.399')]]]`)
                        // Global Opened Camera button
                        .verify.elementPresent(`//div[*[name()='svg' and *[name()='path' and contains(@d,'M0 5a2 2 0 0 1 2-2h7.5a2')]]]`)
                        .verify.attributeContains(`//div[*[name()='svg' and *[name()='path' and contains(@d,'M0 5a2 2 0 0 1 2-2h7.5a2')]]]`, `title`, `Turn off everyone's camera`)
                        .click(`//div[*[name()='svg' and *[name()='path' and contains(@d,'M0 5a2 2 0 0 1 2-2h7.5a2')]]]`)
                        // Click Chat button
                        .click(`//div[*[name()='svg' and *[name()='path' and contains(@d,'M0 2a2 2 0 0 1 2-2h12a2')]]]`)
                        .waitForElementVisible(`//input[@placeholder='Write your message']`)
                        .setValue(`//input[@placeholder='Write your message']`, `GLOBAL-CAMERA-MUTED`)
                        // Click send messsage button
                        .click(`//button[.//*[name()='svg' and *[name()='path' and contains(@d,'M1.946 9.315c-.522')]]]`)
                        .pause(20 * 1000)
                        .verify.elementPresent(getParticipantUnmutedCameraSelectorInDockedRightByName(`Teacher`)) // Unmuted camera
                        .verify.elementPresent(getParticipantMutedCameraSelectorInDockedRightByName(`Student`)) //Muted camera
                        .takeScreenshot(`teacher.png`)
                        // Wait all students finished
                        .pause(15 * 1000)
                        .setValue(`//input[@placeholder='Write your message']`, `ENDED`)
                        // Click send messsage button
                        .click(`//button[.//*[name()='svg' and *[name()='path' and contains(@d,'M1.946 9.315c-.522')]]]`)
                        .pause(10*1000)
                        .takeScreenshot(`host-teacher-finished.png`)
                        .end();
                }
                // Non-Host Teacher
                else {
                    client
                        // Click Chat button
                        .click(`//div[*[name()='svg' and *[name()='path' and contains(@d,'M0 2a2 2 0 0 1 2-2h12a2')]]]`)
                        .waitForElementVisible(`//*[@id="chat-container"]//p[.='GLOBAL-CAMERA-MUTED']`, 60 * 1000)
                        .pause(10 * 1000)
                        .verify.elementPresent(getParticipantUnmutedCameraSelectorInDockedRightByName(`Teacher`))
                        .verify.elementPresent(getParticipantMutedCameraSelectorInDockedRightByName(`Student`))
                        .waitForElementVisible(`//*[@id="chat-container"]//p[.='ENDED']`, 60 * 1000)
                        .takeScreenshot(`teacher.png`)
                        .end();
                }
            })
        } else { //student-group 
            joinRoom(client, tokens.studentTokens[partipantID]);
            client
                // Click Chat button
                .click(`//div[*[name()='svg' and *[name()='path' and contains(@d,'M0 2a2 2 0 0 1 2-2h12a2')]]]`)
                .waitForElementVisible(`//*[@id="chat-container"]//p[.='GLOBAL-CAMERA-MUTED']`, 60 * 1000)
                .pause(10 * 1000)
                .verify.elementPresent(getParticipantUnmutedCameraSelectorInDockedRightByName(`Teacher`))
                .verify.elementPresent(getParticipantMutedCameraSelectorInDockedRightByName(`Student`))
                .verify.elementPresent(getParticipantMutedCameraSelectorInDockedRightByName(`You`))
                .verify.elementPresent(`//button[.//*[name()='svg' and *[name()='path' and contains(@d,'M10.961 12.365a1.99 1.99')]]]`)
                .click(`//button[.//*[name()='svg' and *[name()='path' and contains(@d,'M10.961 12.365a1.99 1.99')]]]`)
                .pause(2000)
                .verify.elementPresent(`//button[.//*[name()='svg' and *[name()='path' and contains(@d,'M10.961 12.365a1.99 1.99')]]]`)
                .waitForElementVisible(`//*[@id="chat-container"]//p[.='ENDED']`, 60 * 1000)
                .takeScreenshot(`student.png`)
                .end();
        }
    }
}
